/*Table structure for table `glledger` */

DROP TABLE IF EXISTS `glledger`;

CREATE TABLE `glledger` (
  `fin_rec_id` int(11) NOT NULL AUTO_INCREMENT,
  `fst_trx_sourcecode` varchar(5) DEFAULT NULL COMMENT 'SO:SALES ORDER|PO:PURCHASE ORDER|CBOUT:CASHBAK OUT|PINV:PURCHASE INVOICE',
  `fin_trx_id` int(11) DEFAULT NULL,
  `fst_trx_no` varchar(25) DEFAULT NULL,
  `fin_branch_id` int(11) DEFAULT NULL,
  `fdt_trx_datetime` datetime DEFAULT NULL,
  `fst_account_code` varchar(100) DEFAULT NULL,
  `fst_account_name` varchar(255) DEFAULT NULL,
  `fst_reference` text DEFAULT NULL,
  `fdc_debit` decimal(12,2) DEFAULT NULL,
  `fdc_credit` decimal(12,2) DEFAULT NULL,
  `fdc_origin_debit` decimal(12,2) DEFAULT NULL,
  `fdc_origin_credit` decimal(12,2) DEFAULT NULL,
  `fst_orgi_curr_code` varchar(10) DEFAULT NULL,
  `fdc_orgi_rate` decimal(12,2) DEFAULT NULL,
  `fst_no_ref_bank` varchar(20) DEFAULT NULL,
  `fin_pcc_id` int(11) DEFAULT NULL COMMENT 'Profit & Cost Center',
  `fin_pc_divisi_id` int(11) DEFAULT NULL COMMENT 'untuk analisa biaya per departement',
  `fin_pc_customer_id` int(11) DEFAULT NULL COMMENT 'untuk analisa customer jatuhnya perarea dan secara nasional',
  `fin_pc_project_id` int(11) DEFAULT NULL COMMENT 'untuk analisa biaya per project',
  `fin_relation_id` int(11) DEFAULT NULL COMMENT 'data terkait hutang dan piutang',
  `fbl_claimed_cashbank_receive_unknown` tinyint(1) DEFAULT 0,
  `fbl_is_flip` tinyint(1) DEFAULT 0,
  `fst_active` enum('A','S','D') DEFAULT NULL,
  `fin_input_id` int(11) DEFAULT NULL,
  `fdt_input_datetime` datetime DEFAULT NULL,
  `fin_update_id` int(11) DEFAULT NULL,
  `fdt_update` datetime DEFAULT NULL,
  PRIMARY KEY (`fin_rec_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3981 DEFAULT CHARSET=latin1;

